import React from 'react';
class Header extends React.Component{
	constructor(props){
		super(props);
	}
	render(){
		return(
			<div className="section header">Hi, I'm <h1>Mary Collins, UI developer and Digital Designer.</h1></div>
			);
	}
}
export default Header;
